import React from 'react'
import styled from 'styled-components'
import { NavLink } from 'react-router-dom'
import house from '../Images/house.png'

const PersonalProffiency: React.FC = () => {

    return (
        <StyledContainer>
            <StyledSectionsHolder>
                <StyledSections to='/' exact><img width="30px" height="30px" src={house} alt='house to show that this is a button to home' /></StyledSections>
            </StyledSectionsHolder>
            <StyledInnerContainer>
                <StyledInnerGrouping>
                <MiniHeader>Html5</MiniHeader>
                </StyledInnerGrouping>
                <StyledInnerGrouping>
                <MiniHeader>Html5</MiniHeader>
                </StyledInnerGrouping>
                <StyledInnerGrouping>
                <MiniHeader>Html5</MiniHeader>
                </StyledInnerGrouping>
                <VerticalSpacer />
                <StyledInnerGrouping>
                </StyledInnerGrouping>
            </StyledInnerContainer>
        </StyledContainer>
    )
}
const VerticalSpacer = styled.div`
width: 15px;
`

const StyledContainer = styled.div`
display: flex;
flex-flow: column;
margin-left: auto;
margin-right: auto;
border-radius: 4px;
justify-content: center;
width: 80%;
height: 90%;
background-color: #008B8B;
`
const StyledInnerContainer = styled.div`
display: flex;
flex-flow: row;
margin-top: 80px;
margin-left: auto;
margin-right: auto;
justify-content: center;
width: 80%;
height: 15%;
`

const StyledInnerGrouping = styled.div`
width: 33%;
height: 100px;
display: flex;
flex-direction: column;
align-items: center;
`

const StyledSections = styled(NavLink)`
    height: 10%;
    width: 10%;
    padding:2%;
`
const StyledSectionsHolder = styled.nav`
    position: absolute;
    color:unset;
    text-decoration: none;
    top: 3%;
    left: 3%;
    height: 15%;
    width: 15%;
    display: flex;
`
const MiniHeader = styled.h4`
text-align: center
`
export default PersonalProffiency
